import classes from './Button.module.css'

export default function Button({ props, value }) {

   let butClass

   if (pbutType === 'sign') butClass = classes.sign + classes.button
   if (butType === 'num') butClass = classes.num + classes.button

   return (
      <button {...props} className={butClass}>
         {value}
      </button>
   )
}
